        api.get("/users").then(response => {
            setUsers(response.data);
        })
    },[])
    alert(users);
    return(
        <div id="user-container">
            <h1>Lista de Usuários</h1>
            <ul className="user-list">
                <li>
                    <strong>Nome:</strong>
                    <p>fulano de tal</p>
                    <strong>Email:</strong>
                    <p>XXXXXXX</p>
                    <strong>Idade:</strong>
                    <p>XXXXXXX</p>
                    <strong>Empresa:</strong>
                    <p>XXXXXXX</p>
                </li>
            </ul>
        </div>
    );

}
export default User;
